import React from 'react';
import './Board.css';

class PostList extends React.Component{

    static defaultProps = {
        post_picture :'',
        post_user_name :'홍길동',
        post_date : '2022.05.27',
        post_contents:'엉덩이가 뜨거워 엄마아~~ 엄마아~~~ '
    }
    render(){
        return(

            <div className="postList_box">
                <div className="post_user_box">
                    <div className="post_user_pic"></div>
                    <span className="post_user_name">{this.props.post_user_name}</span>
                    <div className="post_date">{this.props.post_date}</div>
                </div>
                
                <div className="post_contents">{this.props.post_contents}</div>

            </div>
    
        );
    }
    
}
export default PostList;
